import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar/Navbar';
import Shop from './pages/Shop';
import ShopCategory from './pages/ShopCategory';
import Product from './pages/Product';
import Cart from './pages/Cart';
import Loginsignup from './pages/LoginSignup';
import Footer from './components/Footer/Footer';
import mensbanner from './components/assets/banner_mens.png';
import kidsbanner from './components/assets/banner_kids.png';
import womensbanner from './components/assets/banner_women.png';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path='/' element={<Shop />} />
          <Route path='/Mens' element={<ShopCategory banner={mensbanner} category="Mens" />} />
          <Route path='/Womens' element={<ShopCategory banner={womensbanner} category="Womens" />} />
          <Route path='/Kids' element={<ShopCategory banner={kidsbanner} category="Kids" />} />
          <Route path='/Product' element={<Product />} />
          <Route path='/ProductID' element={<Product />} />
          <Route path='/Cart' element={<Cart />} />
          <Route path='/Login' element={<Loginsignup />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
}

export default App;
